string leap(int y)
{
	if (y % 100 == 0 && y % 400 == 0)
	{
		return "leap";
	}
	else if (y % 100 == 0 && y % 400 != 0)
	{
		return "not leap";
	}
	else if (y % 4 == 0)
	{
		return "leap";
	}
	else if (y % 4 != 0)
	{
		return "not leap";
	}
	else return "error";
}

