        }
        $this->set(compact('user'));
    }

 public function regristation()
    {
        $user = $this->Users->newEmptyEntity();
        if ($this->request->is('post')) {
            $param = $this->request->getData();
            $user = $this->Users->patchEntity($user, $this->request->getData());
